import React from "react";
import Admin from "./pages/admin";
import Login from "./pages/admin/Login";
import Home from "./pages/Home";
import Contact from "./pages/Contac";
import { Layout } from "antd";
function App() {
  return (
    <div>
      <h1>Estamos en app.js</h1>
      <Admin />
      <Login />
      <Home />
      <Contact />
    </div>
  );
}

export default App;
